import './App.css';

function App() {

  return (
    <div className="App">
      <div className="indHouseContainer">
        <div className="indHousePhotoContainer">
          <img src="https://images.estately.net/22_14044376_0_1552942469_320x212a.jpg" />
        </div>
        <div className="indHouseDetailsContainer">
        </div>
        <div className="indHouseButtonsContainer">
        </div>
      </div>
    </div>
  );
}

export default App;


